import { useState, useEffect } from 'react'
import * as styleSass from '../../../styles/buttons.module.scss'

function Button(props, { styleProp }) {
  const conStyle = {
    width: props.width,
    height: props.height,
    borderRadius: props.rounded,
  }
  return (
    <>
      {styleProp ? (
        <button style={styleProp} className={styleSass.button}>
          {props.children}
        </button>
      ) : (
        <button style={conStyle} className={styleSass.button}>
          {props.children}
        </button>
      )}
    </>
  )
}
export default Button
